XmlNodeList selectedNodes = xmlDoc.SelectNodes("/tns:feed/tns:entry", nsMgr);\nforeach (XmlNode selectedNode in selectedNodes)\n{\n    string id = selectedNode.SelectSingleNode("tns:id", nsMgr)?.InnerText;\n    string date = selectedNode.SelectSingleNode("tns:updated", nsMgr)?.InnerText; // Note: Often the date is in <updated> tag\n    string title = selectedNode.SelectSingleNode("tns:title", nsMgr)?.InnerText;\n    string link = selectedNode.SelectSingleNode("tns:link/@href", nsMgr)?.Value; // Link attribute is typically @href\n\n    Console.WriteLine($"ID: {id}, Date: {date}, Title: {title}, Link: {link}");\n}